import React, { useState, useEffect } from "react";
import Navbar from "./Navbar";
import NewsFeed from "./NewsFeed";

function App() {
  const [searchQuery, setSearchQuery] = useState("");
  const [weather, setWeather] = useState(null);
  const [state, setState] = useState("");

  const topStories = [
    {
      id: "1",
      source: "NDTV",
      title: "Trump Questions India Voter Turnout Again...",
      snippet: "Short summary of the news article here...",
      image: "https://ichef.bbci.co.uk/ace/standard/956/cpsprodpb/f433/live/c8c78fc0-f164-11ef-afbd-5d6789bb6e08.jpg",
    },
    {
      id: "2",
      source: "The Times of India",
      title: "BJP Gains More Ground As Trump Repeats...",
      snippet: "Short summary of the news article here...",
      image: "https://bsmedia.business-standard.com/_media/bs/img/article/2025-02/14/full/1739505835-4452.jpg",
    },
  ];

  const localNews = [
    { id: "1", title: "Local festival boosts tourism in Kerala." },
    { id: "2", title: "Government plans new infrastructure projects." },
  ];

 // Fetch Weather and State Data
useEffect(() => {
  const latitude = 10.8505; // Kochi coordinates
  const longitude = 76.2711;

    const fetchWeather = async () => {
      try {
        // Fetch Weather Data
        const weatherRes = await fetch(
          `https://api.open-meteo.com/v1/forecast?latitude=${latitude}&longitude=${longitude}&current_weather=true`
        );
        const weatherData = await weatherRes.json();
        setWeather(weatherData.current_weather);
        setState("KOCHI"); // Directly set to KOCHI instead of fetching state
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchWeather();
  }, []);

  return (
    <div style={styles.page}>
      <Navbar onSearch={setSearchQuery} />

      <div style={styles.container}>
        <div style={styles.briefing}>
          <h1 style={styles.heading}>Your briefing</h1>
          <p style={styles.subtext}>{new Date().toDateString()}</p>
        </div>

        <div style={styles.grid}>
          {/* Main News Column */}
          <div style={styles.centerColumn}>
            <NewsFeed />
          </div>

          {/* Weather Column */}
          <div style={styles.rightColumn}>
            {weather && state && (
              <div style={styles.weatherCard}>
                <div style={styles.weatherContent}>
                  <span style={styles.cityName}>{state}</span>
                  {weather.weathercode === 0 ? "☀️" : "☁️"}
                  <span style={styles.temperature}>{weather.temperature}°C</span>
                  <span style={styles.climate}>
                    {weather.weathercode === 0 ? "Clear" : "Cloudy"}
                  </span>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

// ✅ Updated Styles
const styles = {
  page: {
    fontFamily: "Roboto, sans-serif",
    backgroundColor: "#0a192f",
    minHeight: "100vh",
    paddingTop: "70px",
  },
  container: { maxWidth: "1200px", margin: "0 auto", padding: "20px" },
  briefing: { marginBottom: "20px" },

  grid: {
    display: "grid",
    gridTemplateColumns: "2fr 1fr",
    gap: "20px",
  },

  centerColumn: {
    display: "flex",
    flexDirection: "column",
    gap: "16px",
  },

  rightColumn: {
    display: "flex",
    flexDirection: "column",
    gap: "16px",
  },

  weatherCard: {
    backgroundColor: "#112240",
    padding: "20px",
    borderRadius: "12px",
    textAlign: "center",
    boxShadow: "0 4px 6px rgba(0, 255, 136, 0.1)",
  },

  weatherContent: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "8px",
    fontSize: "24px",
  },

  cityName: {
    color: "#00ff88",
    fontSize: "20px",
    fontWeight: "500",
    marginBottom: "4px",
  },

  temperature: {
    color: "#00ff88",
    fontWeight: "bold",
    fontSize: "32px",
  },

  climate: {
    color: "#ffffff",
    fontSize: "18px",
  },

  newsCard: {
    display: "flex",
    backgroundColor: "#1E1E1E",
    borderRadius: "8px",
    padding: "16px",
  },

  newsImage: {
    width: "150px",
    height: "100px",
    objectFit: "cover",
    marginRight: "16px",
    borderRadius: "8px",
  },

  source: { fontSize: "0.8rem", color: "#4CAF50", marginBottom: "4px" },
  heading: { color: "#FFD700", fontWeight: "bold" },
  subtext: { color: "#C0C0C0" },

  localNewsCard: {
    backgroundColor: "#1E1E1E",
    padding: "10px",
    borderRadius: "8px",
  },

  localNewsItem: {
    padding: "5px 0",
  },

  localNewsTitle: { color: "#FFF", fontSize: "16px" },
};
export default App;
